import React from 'react'
import '../container/quizAss.css'
function QuizAss() {
  return (
    <div>
              <select>
                 <option value='option1'>Quiz</option>
                 <option value='option2'>Assignment</option>
               </select>
    </div>
  )
}

export default QuizAss
